import React, { Component } from "react";
import "./counter.css";
class Counter extends Component {
  render() {
    return (
      <div class="header">
        <p class="heading">CINEPHILE</p>{" "}
        <div class="searchbar">
          <input
            type="text"
            id="myInput"
            onkeyup="myFunction()"
            placeholder="Enter movie Name here"
          ></input>
          <button class="gosearch">GO</button>
        </div>
      </div>
    );
  }
}

export default Counter;
